  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:09.470906\",\n\t\"name\": \"forest-management-plan-great-dismal-swamp-national-wildlife-refuge-1987\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of the timber management
  program at Great Dismal Swamp National Wildlife Refuge are: 1) protecting and preserving
  the unique and outstanding ecosystem as well as perpetuating the diversity of animal
  and plant life; 2) initial timbering activities will concentrate on preserving and
  perpetuating those shade intolerant species requiring disturbance for their regeneration
  to include Atlantic white cedar; 3) after adequate study, timbering may be necessary
  to reduce the over-abundant upland speciea, such as red maple; 4.) the most economical
  and practical methods will be pursued for biological manipulation, but commercial
  timbering for the sake of revenue will not be considered as.an objective in management;
  5) in the future, manipulation of water levels in a long-term program should assist
  in reducing the vitality of the invading upland species and in stabilizing the more
  typical swamp species.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
